import React from "react";
import './style.css';

const Contact = () =>{
    return (
        <>
         <div className="cn">
             <h1 className="text-primary">Contact</h1>
             <a href="tirth1082@gmail.com" target={"_blank"}><span typeof="button" className="btn btn-blue-900">Mail</span></a>
         </div>
        </>
    );
}


export default Contact;
